加合物：

离子公式可能包含使用 defacto 标准表示法的加合物描述，请参见 http://fiehnlab.ucdavis.edu/staff/kind/Metabolomics/MS-Adduct-Calculator（例如"C47H51NO14[M+IsoProp+H]"）。

当仅已知离子电荷时（通常是片段的情况），可能使用仅电荷加合物，比如 "[M+]" (z=1)、"[M-]" (z=-1)、"[M+3]" (z=3) 等。

支持乘数（例如，"[2M+K]" 中的“2”），以及同位素标记（例如， "[M2Cl37+H]"中的“2Cl37”）。

